  if(LZ == 0) {
    LZ = L;
  }

  g_rgi_C0 = 1. - 8.*g_rgi_C1;
  g_ka_csw_8 = g_kappa*g_c_sw/8.;
  
  fclose(yyout);
  fclose(yyin);
  return(0);
